import React from "react";
import { connect } from "react-redux";
import './listing.scss';

const Listing = props => {

    const SingleData = (data) => {
        return (
            <li className={'single-data'}>
                {data.title}
            </li>
        )
    }

    return (
        <div className={'main-container'}>
            <div className={'heading'}>Welcome to Anshul's Blogs</div>
            <ul className={'list-ul'}>
                {props.listingData.length?props.listingData.map(cur => {
                    return (
                        <SingleData title={cur.title}/>
                    )
                }):null}
            </ul>
        </div>
    );
}; 

const mapStateToProps = state => {
    return {
        listingData: state.listing?.listingData
    }
}

export default connect(mapStateToProps)(Listing);
